import React from 'react';

const Contact = () => {

    return(

        <>

            <div class="my-5">

                <h1 className="text-center">Contact Us</h1>

            </div>

            <div className="container-fluid">

                <div className="row">

                    <div className="col-8 mx-auto">

                    </div>

                </div>

            </div>

        </>

    );

}

export default  Contact;
